import {useState, createContext} from "react";

// Create context object
export const ClientTrackerContext = createContext();

// create a provider for components to consume and subscribe to changes
export const ClientTrackerProvider = (props) => {
    const [result, setResult] = useState([]);

  return (
    <ClientTrackerContext.Provider value={[result, setResult]}>
      {props.children}
    </ClientTrackerContext.Provider>
  );
};
